import React from 'react';
//import axios from 'axios'
import logo from './logo.svg';
import './App.css';
import AuthorList from './components/Author.js'

class App extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            'authors': []
        }
    }

    render () {
        return (
            <div>
                Привет
                {<AuthorList authors={this.state.authors} />}
            </div>
        )
    }
}

export default App;
